import React from "react";
import Header from "./Header";
import BottomNav from "./BottomNav";

export default function Layout({ children }) {
  return (
    <div className="min-h-screen bg-green-50">
      <Header />
      <main className="pb-24">{children}</main>
      <BottomNav />
    </div>
  );
}
